import React from 'react'
import { useState } from 'react'
import axios from 'axios'
import { useEffect } from 'react'

const Adminpage = () => {
  const [details, setDetails] = useState([])
  useEffect(() => {
    axios.get('http://localhost:5001/auth/message').then((response) => {
      console.log(response.data)
      setDetails(response.data)
    })

  }, [])
  return (
    <div className='flex justify-center grid grid-cols-3 pt-16'>
      {details.map((data) => {
        return (
          <>
            <div className=' flex justify-center  '>
              <div className='bg-slate-400 p-2 rounded-lg w-full mt-2 gap-2 mx-2 grid grid-cols-1 flex'>
                <label className='w-fit text-black' htmlFor="">{data.username}</label>
                <p className='bg-slate-100 h-20 text-sm overflow-y-scroll rounded-lg py-2 flex px-2'>{data.message}</p>
                <label className='w-fit text-slate-300 text-sm' htmlFor="">{data.date}</label>

              </div>
            </div>
          </>
        )
      })}

    </div>
  )
}

export default Adminpage
